  output Real y "result of applying the HH-style equation tau = 1/(alpha + beta)";
algorithm
  y := 1.0 / (InaMo.Cells.VariableCa.NCell.st.fa.falpha(x, 0.0, -1000.0 / 10.0, 95.0 / 150.4) + InaMo.Cells.VariableCa.NCell.st.fa.fbeta(x, 0.0, -1000.0 / 700.0, 50.0 / 150.4)) + off;
